import { SignIn } from '../../Components/SignIn/SignIn'
import { SignUp } from '../../Components/SignUp/SignUp'
import './style.css'


export function HomePage() {

    return (
        <div id="home">
            <SignIn title="Welcome Back!" text1="To keep connected with us." text2="please login with your personal info."/>
            <SignUp title="Create Account" text="or use your email for registration."/>
        </div>
    )
}
